import React, {Component} from 'react';
import {Grid, Cell} from 'react-mdl';
import Education from './Education';
import Experience from './Experience';
import Skills from './Skills';

class Resume extends Component {

  render() {
    return (
        <div>
          <Grid>
            <Cell col={4}>
              <div style={{textAlign: 'center'}}>
                <img src="https://scontent-dfw5-1.xx.fbcdn.net/v/t1.0-9/70796197_10156751572802123_2661320693341224960_n.jpg?_nc_cat=110&_nc_oc=AQlGZ8VYbwyhNDB9edBtjzChosrZOCwt1bN3A_nF_JfRhzlUblv0rPogPYkaYyt2PN88KcOGkkqRW4WEXEiXufxh&_nc_ht=scontent-dfw5-1.xx&oh=b9ce21ab08c22860aadbe8d605a7d163&oe=5E258D65" alt="resume-pic" style={{height: '200px'}} />
              </div>
              <h2 style={{paddingTop: '2em'}}>Austin Puckett</h2>
              <h4 style={{color: 'grey'}}>Software Developer</h4>
              <hr style={{borderTop: '3px solid #833fb2', width: '61%'}}/>

            </Cell>
          </Grid>
        </div>
    );
  }
}


export default Resume;
